    const Course = ['TE1','TE2','TE3','TE4','TE5','TE6','TE7','TE8','TE9'];
    const Schedule = new Array(250);
    const test = Schedule.fill(null)
    const size = Schedule.length
    //console.log(size);
    function random(){
        let random1 = Math.floor(Math.random() * size+1);
        //console.log("1:" + Schedule[random1])
        if(test[random1] === null){
            Schedule[random1] = Course;
             return size = 0;
        }else{
            random1 = Math.floor(Math.random() * size +1);
        }
    }
    var i = 0;
    while (i < Schedule.length){
        random()
        i++;
    }
    //const test1 = Schedule.push(random1)
    console.log("Random: " + Schedule);

